import React, { Component } from 'react'
import "./slider.css"
export class slider extends Component {
    render() {
        return (
            <div className="slidecontainer">
                <input type="range" min="1" max="100" value="50" className="slider" id="myRange"/>
            </div>
        )
    }
}

export default slider
